import React from 'react'
import styled from 'styled-components'

const ButtonFi = styled.button

function clickMe(){
alert('You clicked me');
}

export default function ButtonFilter (){
  return(
    <div>
      <ButtonFi onClick={clickMe}>
        Button
      </ButtonFi>
      </div>
  )
}
